El modelo de datos de JavaScript
Conocer un lenguaje de programación se traduce básicamente en conocer su
sintaxis, modelo de datos, modelo de ejecución y estilo.
Durante esta lección, codificarás en JavaScript lo aprendido en la lección
anterior.
No todos los lenguajes permiten una transcripción 1 a 1 de los conceptos que
recogemos en el modelo. Por ejemplo, JavaScript no tiene un mecanismo para crear
tipos nuevos, pero tiene otros mecanismos que permiten implementar una
funcionalidad similar.
Experimentando con JavaScript
Vas a experimentar con JavaScript, así que necesitarás una forma rápida de
inspeccionar expresiones y obtener feedback de lo que estás haciendo. La mejor
forma es utilizar la consola de Node. Por ejemplo:
$ node --use_strict

La opción --use_strict activa el modo estricto de JavaScript, que simplifica
algunos aspectos del lenguaje. El modo estricto recorta algunas características,
pero los beneficios son mayores que las pérdidas.
Ahora puedes probar a introducir algunas expresiones:
> 40 + 2
42
> var point = { x: 1, y: 1 };
undefined
> point
{ x: 1, y: 1 }
> point.x
1

Para limpiar la pantalla presiona ctrl+l. Para salir de Node, presiona
ctrl+c dos veces seguidas. Si escribiendo una expresión Node parece no
responder, presiona ctrl+c una vez para cancelar la expresión.
Si no quieres lidiar con la consola de Node, siempre puedes escribir un
programa y usar console.log() para mostrar expresiones por pantalla.
// en el fichero prueba.js
console.log(40 + 2);
var point = { x: 1, y: 1 };
console.log(point);
console.log('Coordenada X:', point.x);

Ahora ejecuta el programa con Node:
$ node prueba.js
42
{ x: 1, y: 1 }
Coordenada X: 1

Esta lección asume que utilizarás una única sesión de la consola de Node, a
menos que se indique lo contrario.
Para la mayoría de los ejemplos, puedes mantener la misma sesión abierta, pero
si te encuentras con algo inesperado, antes de nada prueba a reiniciar la
consola. Para reiniciar la consola tienes que salir y volver a entrar.
Lo mejor es que se tenga este texto abierto en una ventana (o impreso), y la
consola de Node en otra.
Tipos primitivos
Se llaman tipos primitivos a aquellos que vienen con el lenguaje y que
permiten la creación de nuevos tipos más complejos. En JavaScript, los tipos
primitivos son: booleanos, números, cadenas (strings), objetos y
funciones.
// En los comentarios hay más valores posibles para cada uno de los tipos.
var bool = true; // false
var number = 1234.5; // 42, -Infinity, +Infinity
var text = 'I want to be a pirate!'; // "I want to be a pirate"
var object = {}; // [], null
var code = function () { return 42; };

Los puedes reconocer porque responden de manera distinta al operador typeof.
Observa cómo los tipos son cadenas de texto:
typeof true;
typeof 1234.5;
typeof 'I want to be a pirate!';
typeof {};
typeof function () { return 42; };

En JavaScript se puede declarar una variable y no asignarle ningún valor. En
este caso, el tipo de la variable será 'undefined'.
var x;
typeof x;
x = 5; // tan pronto como le demos un valor, el tipo dejará de ser undefined.
typeof x;

Objetos en JavaScript
De entre todos los tipos, vamos a prestar especial atención a aquel cuyos
valores permiten la composición con otros valores. Estos son los de tipo 'object' (objeto).
En JavaScript, los objetos son colecciones de valores etiquetados. Por ejemplo,
si queremos representar el punto (10, 15) del plano XY, podemos etiquetar el
valor en el eje X con la cadena 'x' y el valor en el eje Y con la cadena
'y'.
var point = { 'x': 10, 'y': 15 };

Cada par etiqueta y valor se llama propiedad del objeto. No es algo
estricto, pero cuando se habla de las propiedades de un objeto, se suele
referir a los valores; mientras que para hablar de las etiquetas se suele
decir nombre de la propiedad.
Si los nombres de las propiedades se escriben siguiendo las
reglas de formación de identificadores en JavaScript, las
comillas no son necesarias y podemos ahorrárnoslas.
var point = { x: 10, y: 10 }; // mucho más conveniente.

Este es el caso más frecuente, el recomendado, y el que usaremos a los largo
de este material; pero conviene saber que, por debajo, el nombre de la
propiedad es una cadena.
Para acceder a las propiedades de un objeto, usamos los corchetes [ ] con el
nombre de la propiedad entre estos:
point['x'];
point['y'];

De nuevo, si seguimos las reglas de formación de identificadores, podemos usar
la notación de punto para acceder a la propiedad, mucho más rápida de
escribir:
point.x;
point.y;

Para cambiar el valor de una propiedad se utiliza el operador de asignación:
point.x = 0;
point.y = 0;
point['x'] = 0;
point['y'] = 0;

Si se accede a una propiedad que no existe, obtendras el valor undefined:
var label = point.label; // será undefined. Compruébalo con typeof.

En cualquier momento podemos crear propiedades nuevas asignándoles algo.
point.label = 'origin';
point;

Arrays
Las listas o arrays son colecciones de datos ordenados.
Por ejemplo, la lista de comandos de un menú en un videojuego:
var menu = ['Attack', 'Defense', 'Inventory'];

En este tipo de objetos, el orden importa. Para acceder a los distintos valores
se utiliza el índice del elemento en la lista, entre corchetes. Los índices
comienzan en 0, y no en 1.
menu[0];
menu[1];
menu[2];

Se puede consultar la longitud de un array accediendo a la propiedad length.
menu.length;

Se puede añadir un elemento al final del array llamando al método push:
menu.push('Magic');

También se puede quitar un elemento por el final usando el método pop:
menu.pop();

Se puede alterar un array (insertar o borrar elementos), en cualquier lugar,
usando el método splice:
// Inspecciona la lista tras cada operación.
menu = ['Attack', 'Defense', 'Inventory'];
menu.splice(2, 0, 'Magic'); // añade Magic antes de Inventory.
menu.splice(2, 2, 'Ench. Inventory'); // reemplaza Magic and Inventory with Ench. Inventory.
menu.splice(0, 0, 'Wait'); // añade Wait al principio de la lista.

Como en el caso de los objetos, podemos cambiar cualquier valor en cualquier
momento usando el operador de asignación.
menu[0] = 'Special'; // reemplaza Wait con Special

También como en el caso de los objetos, podemos acceder a un valor que no existe
y recuperarlo o asignarlo en cualquier momento.
menu;
menu.length;
var item = menu[10];
typeof item; // será undefined.
menu[10] = 'Secret';
menu;
menu.length;

Si asignamos a un índice por encima de la longitud actual, se extenderá el
array hasta ese índice.
Distinguir entre objetos y arrays
Arrays y objetos tienen tipo 'object', así que se ha de usar el método
Array.isArray()
para distinguirlos.
var obj = {}; // el objeto vacío es tan válido como cualquier otro.
var arr = []; // una lista sin elementos, como te puedes imaginar.
typeof obj; // será object.
typeof arr; // será object.
Array.isArray(obj); // será false.
Array.isArray(arr); // será true.

null
Existe un último valor para el tipo objeto, que es null. Este valor representa
la ausencia de objeto y se suele utilizar para:

En funciones en las que se pregunta por un objeto, indicar que no se ha
encontrado tal objeto.

En relaciones de composición, indicar que el objeto compuesto ya no necesita
al objeto componente.


Por ejemplo, en un RPG, podemos preguntar por el siguiente enemigo vivo para
comprobar si debemos continuar la batalla:
function getNextAliveEnemy() {
  var nextEnemy;
  if (aliveEnemies.length > 0) {
    nextEnemy = aliveEnemies[0];
  }
  else {
    nextEnemy = null;
  }
  return nextEnemy;
}

O bien, supón la ficha de personaje de un héroe:
var hero = { sword: null, shield: null };
hero.sword = { attack: 20, magic: 5 }; // coge una espada.
hero.sword = null; // suelta la espada.

Composición de objetos
Objetos y arrays permiten cualquier composición de objetos. Es decir, sus
valores pueden ser otros objetos y arrays, números, cadenas o funciones.
El siguiente ejemplo muestra una posible ficha de personaje de un RPG:
var hero = {
  name: 'Link',
  life: 100,
  weapon: { kind: 'sword', power: 20, magicPower: 5 },
  defense: { kind: 'shield', power: 5, magicPower: 0 },
  // Inventario por slots. Dos slots vacíos y un último con 5 pociones.
  inventory: [
    { item: null, count: 0},
    { item: null, count: 0},
    { item: { kind: 'potion', power: 15 }, count: 5}
  ]
};

Algunas propiedades:
hero.name; // el nombre del héroe
hero.weapon.kind; // el tipo de arma
hero.inventory[0]; // el primer slot del inventario
hero.inventory[0].item; // qué hay en el primer slot del inventario
hero.inventory[2].item.power; // el poder del item del 3r slot del inventario

Identidad de los objetos
En JavaScript, el operador de igualdad es === (el triple igual). Esto permite
comparar dos objetos y decidir si son iguales. También existe el operador de
desigualdad !== que compara dos objetos y decide si no son iguales.
Para los tipos 'bool', 'string', 'number' y 'undefined', dos valores son
iguales si tienen la misma forma:
// Todas estas comparaciones son verdaderas.
"Hola" === "Hola";
"Hola" !== "hola";
true === true;
123 === 123.0;
123 !== "123";
123 === 122 + 1; // primero se resuelve la expresión, luego se compara.
undefined === undefined;

Para el tipo object, dos objetos son iguales sólo si se refieren al mismo
objeto:
({} !== {}); // da igual la forma, esto son dos objetos distintos.
({} !== []);
[] !== []; // igual que antes.
[1, 2, 3] !== [1, 2, 3]; // la forma da igual, los objetos son distintos.
null === null; // pero con null funciona porque sólo hay un valor null.
var obj = {};
var sameObj = obj;
var another = {};
sameObj === obj; // funciona porque ambos nombres se refieren al mismo objeto.
sameObj !== another; // insisto, distintos, pese a la forma.

Objetos y paso de mensajes
Los objetos de JavaScript y el poder usar código como un valor más, permiten
codificar los conceptos de objeto y paso de mensajes de la programación
orientada a objetos.
Codificando el estado
Con lo que se ha visto hasta ahora deberías tener el conocimiento suficiente
para codificar el estado. El conjunto de atributos del objeto en el modelo
orientado a objetos se traduce en el conjunto de propiedades de los objetos
JavaScript.
En el ejemplo de Space Invaders, el estado de los enemigos formado por:

Se puede codificar mediante:
var enemy = {
  graphic: 'specie01.png',
  currentDirection: 'right',
  position: { x: 10, y: 10 },
  score: 40
};

La primera limitación en JavasScript es que no se puede restringir el acceso
a las propiedades de un objeto (es decir, no hay propiedades privadas). Así,
nada nos impide poder modificar la posición directamente.
enemy.position.x = 100; // perfectamente válido.

Lo único que se puede hacer es desaconsejar al usuario de ese código que utilice
ciertas propiedades. Una práctica muy común en JavaScript es añadir un guión
bajo _ a los atributos que consideramos que son privados:
var enemy = {
  _graphic: 'specie01.png',
  _currentDirection: 'right',
  _position: { x: 10, y: 10 },
  _score: 40
};

Pero, insistimos, esto es una convención y se puede seguir accediendo a los
atributos que tengan este guión bajo:
enemy._position.x = 100; // perfectamente válido también.

Codificando la API
Las acciones que forman la API de un objeto, los métodos, pueden
implementarse como funciones en propiedades de un objeto.

var enemy = {
  _graphic: 'specie01.png',
  _currentDirection: 'right',
  _position: { x: 10, y: 10 },
  _score: 40,

  moveLeft: function () { console.log('Going left!'); },
  moveRight: function () { console.log('Going right!'); },
  advance: function () { console.log('Marching forward!'); },
  shoot: function () { console.log('PICHIUM!'); } // (es un láser)
};

Enviar un mensaje a un objeto consiste sencillamente acceder a la propiedad
del destinatario, que será una función, y llamarla.
enemy.shoot(); // primero accedemos con punto, luego llamamos con ().
enemy.moveLeft();
enemy.moveLeft();
enemy.advance();
enemy['shoot'](); // es lo mismo, acceder con corchetes y llamar con ().

Cualquier función puede actuar como método. Para que actúe como un método
tan sólo es necesario llamarla desde la propiedad de un objeto. Y, como
cualquier propiedad de un objeto, podemos cambiarla en cualquier momento:
enemy.shoot(); // PICHIUM!
enemy.shoot = function () { console.log('PAÑUM!'); };
enemy.shoot(); // PAÑUM!

Ahora bien, observa el siguiente comportamiento:
enemy; // fíjate en la posición.
enemy.moveLeft();
enemy; // fíjate en la posición otra vez.

Obviamente, echando un vistazo a lo que hace moveLeft, no podríamos decir
que cambia el estado del objeto destinatario del mensaje. ¿Cómo podríamos
solucionarlo?
Como cualquier función puede actuar como método, hace falta una forma de
referirse al destinatario del mensaje, si existe. Cuando se usa como un
método, el destinatario se guarda siempre en la variable this.
Gracias a ella, podemos implementar los métodos de movimiento:
enemy.moveLeft = function () { this._position.x -= 2; };
enemy.moveRight = function () { this._position.x += 2; };
enemy.advance = function () { this._position.y += 2; };

Prueba el mismo experimento de antes y observa cómo efectivamente alteramos el
estado del objeto.
enemy; // fíjate en la posición.
enemy.moveLeft();
enemy; // fíjate en la posición otra vez.

El valor the this
El valor de this es uno de los aspectos más controvertidos de JavaScript.
En otros lenguajes, métodos y funciones son cosas distintas y un método
siempre tiene asociado un –y sólo un- objeto, así que this nunca cambia.
Pero en JavaScript, this depende de cómo se llame a la función: si se
llama como si fuera una función, o si se llama como si fuera un método.
Considera la siguiente función:
function inspect() {
  // sólo inspecciona this
  console.log('Tipo:', typeof this);
  console.log('Valor:', this);
}

Y prueba lo siguiente:
// Piensa qué puede valer this antes de probar cada ejemplo.
var ship1 = { name: 'T-Fighter', method: inspect };
var ship2 = { name: 'X-Wing', method: inspect };
ship1.method();
ship2.method();
inspect();

En el último caso, el valor de this es undefined porque la función no se
está usando como un método, por lo que no hay destinatario.
En JavaScript podemos hacer que cualquier objeto sea this en cualquier
función. Para ello usaremos
apply
en una función.
var onlyNameShip = { name: 'Death Star' };
inspect.apply(onlyNameShip); // hace que this valga onlyNameShip en inspect.

A this
se le conoce también como objeto de contexto, y en este material usaremos
este término de vez en cuando.
Consideraciones adicionales
Nombres y valores
Una variable es un nombre. Para el programa, quitando algunas excepciones,
los nombres no tienen significado.
Un valor no es un nombre. De hecho, sólo las funciones pueden tener nombre
con el fin de poder implementar recursividad y un par de cosas más.
Así que no es lo mismo el nombre uno que el valor 1, y por supuesto, no
es obligatoria ninguna relación coherente entre el nombre y el valor.
var uno = 2; // para el programa tiene sentido, quizás para el programador no.

En general, hablando de booleanos, cadenas y números, decimos que los nombres
guardan valores, mientras que si hablamos de objetos y funciones decimos que
los nombres apuntan a objetos o funciones o son referencias a objetos o
funciones.
Funciones, referencias a funciones y llamadas a funciones
Hay dos formas de definir una función. Una es usando la declaración de
función function:
// Introduce una variable factorial que apunta a la función factorial.
function factorial(number) {
  if (number === 0) {
    return 1;
  }
  return number * factorial(number - 1);
} // no hace falta un ';' en este caso.

En este caso, el nombre de la función (antes de los paréntesis) es obligatorio.
Dar nombre a una función tiene dos implicaciones:

Permite implementar llamadas recursivas como la del ejemplo.

Crea un nombre factorial para referirnos a esa función.


La otra forma es usar una expression de función. Esta se parece más a como
crearíamos otros valores, como números o cadenas:
// Introduce una variable recursiveFunction que apunta a OTRA funcion factorial.
var recursiveFunction = function factorial(number) {
  if (number === 0) {
    return 1;
  }
  return number * factorial(number - 1);
}; // ahora sí hace falta ';', como en cualquier asignación.

En este último caso, hay dos nombres. Uno es el nombre de la función
factorial, que existe para poder referirnos a ella dentro del cuerpo de la
función. El otro es la variable recursiveFunction que referencia a la función.
La misma función puede referirse desde múltiples variables o, dicho de otra
manera, tener muchos nombres:
var a = recursiveFunction;
var b = recursiveFunction;
a === b; // es cierto, se refieren a la misma función.
a.name; // el nombre de la función no tiene que ver con el de la variable.
b.name; // lo mismo.
recursiveFunction !== factorial;

Tampoco podemos confundir la referencia a la función factorial y la
llamada a la misma función, por ejemplo: factorial(10).
Con la primera forma nos referimos al objeto que encapsula el código que hay
que ejecutar. No requiere parámetros porque no se quiere ejecutar el código
sino solamente referirse a la función.
Con la segunda, pedimos a la función que se ejecute y por tanto habrá que
aportar todos los parámetros necesarios.
En JavaScript todo es un objeto
Si, como definición alternativa, consideramos como objeto aquello que puede
responder a un mensaje, resulta que en JavaScript todo es un objeto.
Observa los siguiente ejemplos:
true.toString();
3.1415.toFixed(2);
'I want to be a pirate!'.split(' ');
({}).hasOwnProperty('x');
(function (parameter) { return parameter; }).length;

Tipos y constructores de objetos
Hemos comentado que JavaScript no permite modelar tipos nuevos y que
hace falta "dar un rodeo". Esta es una de las principales diferencias con otros
lenguajes orientados a objetos.
Lo que se debe hacer es saltarse el concepto de tipo para abordar directamente
el de constructor.

Vamos a crear dos funciones constructoras: una para puntos y otra para disparos.
function newPoint(x, y) {
    var obj = {};
    obj.x = x;
    obj.y = y;

    return obj;
}

function newShot(position, velocity) {
    var obj = {};
    obj._position = position;
    obj._velocity = velocity;
    obj.advance = function () {
        this._position.y += this._velocity;
    };

    return obj;
}

La forma de las funciones constructoras es muy similar: crear un objeto vacío,
establecer las propiedades del objeto y devolver el nuevo objeto.
Ahora podríamos crear disparos con algo así:
// Velocidad positiva para que se mueva hacia abajo.
var enemyShot = newShot(newPoint(15, 15), 2);

// Velocidad negativa para que se mueva hacia arriba.
var allyShot = newShot(newPoint(15, 585), -2);

enemyShot !== allyShot;

Reaprovechando funcionalidad
El problema con esta aproximación es que estamos creando funciones distintas
para comportamientos idénticos: una función por objeto.
var s1 = newShot(newPoint(15, 15), 2);
var s2 = newShot(newPoint(15, 15), 2);
var s3 = newShot(newPoint(15, 15), 2);
s1.advance !== s2.advance;
s2.advance !== s3.advance;
s3.advance !== s1.advance;

Esto es altamente ineficiente, dado que cada función ocupa un espacio distinto
en memoria.
Realmente no son necesarias tantas funciones, sino una solamente actuando sobre
distintos objetos.
Así que es mejor crear un objeto que contenga únicamente la API:
var shotAPI = {
    advance: function () {
        this._position.y += this._velocity;
    }
};

Y usarlo en la creación del objeto para compartir los métodos de la API:
function newShot(position, velocity) {
    var obj = {};
    obj._position = position;
    obj._velocity = velocity;
    obj.advance = shotAPI.advance;
    return obj;
}

Ahora todas las instancias comparten la misma función, pero cada función actúa
sobre el objeto correspondiente gracias al valor de this:
var s1 = newShot(newPoint(15, 15), 2);
var s2 = newShot(newPoint(15, 15), 2);
var s3 = newShot(newPoint(15, 15), 2);
s1.advance === s2.advance; // ahora SÍ son iguales.
s2.advance === s3.advance;
s3.advance === s1.advance;

Para hacer todavía más fuerte la asociación entre el constructor y la API,
vamos a realizar una pequeña modificación: crear el objeto con
la API como una propiedad de la función constructora, quedando así todo
agrupado en el mismo sitio (la función newShot).
function newShot(position, velocity) {
    var obj = {};
    obj._position = position;
    obj._velocity = velocity;
    obj.advance = newShot.api.advance;
    return obj;
}

// Una función es un objeto, así que le podemos añadir una propiedad.
newShot.api = {
    advance: function () {
        this._position.y += this._velocity;
    }
};

La cadena de prototipos
JavaScript posee una característica muy representativa y única del lenguaje:
la cadena de prototipos.
Puedes experimentar con ella en Object Playground,
una excelente herramienta que te ayudará a visualizarla.
La idea no es complicada: la cadena de prototipos es una lista de búsqueda
para las propiedades. Cada elemento de la cadena es prototipo del
objeto anterior.
Cuando accedes a una propiedad de un objeto, esta propiedad se busca en el
objeto y, si no se encuentra, se busca en el prototipo del objeto, y así
sucesivamente hasta alcanzar la propiedad o el final de esta cadena.
Por ejemplo:
obj1                    obj2               obj3
{ a: 1, b: 2, c: 3} --> { d: 4, e: 5 } --> { f: 6 }
obj1.c -------↑           ↑                  ↑
obj1.d -------------------|                  |
obj1.f --------------------------------------|
obj1.z ------------------------------------------------X
Crear esta jerarquía en JavaScript requiere el uso de Object.create():
// La cadena se monta de atrás hacia adelante.
var obj3 = { f: 6 };
// Encadenamos obj2 a obj3
var obj2 = Object.create(obj3);
obj2.d = 4;
obj2.e = 5;
// Encadenamos obj1 a obj2
var obj1 = Object.create(obj2);
obj1.a = 1;
obj1.b = 2;
obj1.c = 3;

obj1.c;
obj1.d;
obj1.f;
obj1.z; // undefined

El método Object.create() crea un nuevo objeto vacío (como {}) cuyo
prototipo es el objeto pasado como parámetro.
Se puede usar el método hasOwnProperty
para determinar si una propiedad pertenece a un objeto sin atravesar la cadena
de prototipos:
obj1.hasOwnProperty('c'); // true
obj1.hasOwnProperty('d'); // false
obj1.hasOwnProperty('f'); // false
obj1.hasOwnProperty('z'); // false

obj2.hasOwnProperty('c'); // false
obj2.hasOwnProperty('d'); // true
obj2.hasOwnProperty('f'); // false
obj2.hasOwnProperty('z'); // false

obj3.hasOwnProperty('c'); // false
obj3.hasOwnProperty('d'); // false
obj3.hasOwnProperty('f'); // true
obj3.hasOwnProperty('z'); // false

Se puede usar el método Object.getPrototypeOf()
para obtener el prototipo de un objeto:
Object.getPrototypeOf(obj1) === obj2;
Object.getPrototypeOf(obj2) === obj3;
Object.getPrototypeOf(obj3) === Object.prototype;
Object.getPrototypeOf(Object.prototype) === null;

Constructores y cadenas de prototipos
Los prototipos se prestan a ser el lugar ideal para contener la API, que es el
comportamiento común de todos los objetos de un tipo.
var obj = newShot()                               newShot.api
{ _position: { x: 10, y: 10 }, _velocity: 2 } --> { advance: function ... };
obj._position.y ------↑                             ↑
obj.advance ----------------------------------------|
obj.goBack ------------------------------------------------------------------X
Para crear este enlace, modificaremos nuestro constructor de la siguiente forma:
function newShot(position, velocity) {
    // Con esto la API es el prototipo del objeto.
    var obj = Object.create(newShot.api);
    obj._position = position;
    obj._velocity = velocity;

    return obj;
}

newShot.api = {
    advance: function () {
        this._position.y += this._velocity;
    }
};

Prueba ahora a crear un nuevo disparo:
var shot = newShot({x: 0, y: 0}, 2);
shot; // al inspeccionar shot sólo se muestran las propiedades del objeto.
shot.advance; // pero advance existe en su prototipo.
shot.hasOwnProperty('advance'); // false
Object.getPrototypeOf(shot).hasOwnProperty('advance'); // true

Si hacemos esto con todos los constructores, pronto encontraremos un patrón:

Crear un objeto para contener la API.

Implementar la API como propiedades de este objeto.

En el constructor, hacer que este objeto sea el prototipo de un nuevo objeto.

Establecer las propiedades del nuevo objeto con el estado.

Devolver el nuevo objeto.


Sólo los pasos 2 y 4 involucran diferencias de un constructor a otro, todo lo
demás es exactamente igual. Tanto es así, que JavaScript lo tiene en cuenta
y viene con los mecanismos para automatizar los pasos 1, 3 y 5.
Primero, JavaScript permite que cualquier función pueda usarse como
constructor. Por eso, cada vez que escribimos una función, JavaScript crea una
propiedad de la función llamada prototype, que es un
objeto con una única propiedad constructor que apunta a la función.
function anyFunction() {}
anyFunction.prototype;
anyFunction.prototype.constructor === anyFunction;

Esto automatiza el paso 1: ya no es necesario el objeto api que preparábamos
nosotros manualmente. La propiedad prototype es equivalente a la propiedad
api.
Ahora, al llamar a la función con el operador new delante, se crea un nuevo
objeto cuyo prototipo es precisamente la propiedad prototype de la función:
var obj = new anyFunction();
var anotherObj = new anyFunction();

// Los objetos son distintos.
obj !== anotherObj;

// Pero sus prototipos son iguales.
Object.getPrototypeOf(obj) === Object.getPrototypeOf(anotherObj);

// Y además son la propiedad prototype de la función.
Object.getPrototypeOf(obj) === anyFunction.prototype;

Con esto se automatiza el paso 3: ya no es necesario llamar a Object.create()
para establecer la cadena de prototipos entre objeto y API (lo conseguimos
automáticamente al utilizar el operador new).
Finalmente, cuando se llama con new, la función recibe como objeto de
contexto (el this) el elemento que está siendo creado, lo que nos
permite establecer sus atributos.
function Hero(name) {
    this.name = name;
    this.sword = null;
    this.shield = null;
}

var hero = new Hero('Link');
hero;

Si la función no devuelve nada, el resultado del operador new será el
nuevo objeto. Esto automatiza el paso 5: no es necesario devolver el
nuevo objeto, esta devolución se hace implícita al utilizar new.
Observa como quedaría el constructor de un objeto punto:
function Point(x, y) {
    this.x = x;
    this.y = y;
}

Y el del disparo:
function Shot(position, velocity) {
    this._position = position;
    this._velocity = velocity;
}

// El prototipo ya existe, pero le añadimos el método advance()
Shot.prototype.advance = function () {
    this._position.y += this._velocity;
};

Ahora crear los objetos será cuestión de usar new. Emplearemos además nuestro
nuevo tipo punto (Point) para pasar la posición al disparo:
var enemyShot = new Shot(new Point(15, 15), 2);
var allyShot = new Shot(new Point(15, 585), -2);
enemyShot !== allyShot;

Herencia
Ya hemos visto cómo crear objetos con atributos y cómo hacerlo eficazmente,
usando constructores y la cadena de prototipos.
Veremos ahora cómo crear una relación de herencia. Recordemos el ejemplo de
los enemigos y la nave protagonista de la lección anterior:

Necesitaremos nuestros puntos y disparos:
function Point(x, y) {
    this.x = x;
    this.y = y;
}

function Shot(position, velocity) {
    this._position = position;
    this._velocity = velocity;
}

Shot.prototype.advance = function () {
    this._position.y += this._velocity;
};

El constructor y los métodos de los enemigos podrían ser:
function Enemy(graphic, position, score) {
    this._graphic = graphic;
    this._currentDirection = 'right';
    this._position = position;
    this._score = score;
}

Enemy.prototype.moveLeft = function () { this._position.x -= 2; };
Enemy.prototype.moveRight = function () { this._position.x += 2; };
Enemy.prototype.advance = function () { this._position.y += 2; };

Enemy.prototype.shoot = function () {
    var firePosition = new Position(this._position.x, this._position.y + 10);
    var shot = new Shot(firePosition, 2);
    return shot;
};

Y aquí la implementación de la nave aliada:
function Ally(position) {
    this._graphic = 'ally.png';
    this._position = position;
}

Ally.prototype.moveLeft = function () { this._position.x -= 2; };
Ally.prototype.moveRight = function () { this._position.x += 2; };

Ally.prototype.shoot = function () {
    var firePosition = new Position(this._position.x, this._position.y - 10);
    var shot = new Shot(firePosition, -2);
    return shot;
};

Ahora podemos generalizar y pensar en un constructor que capture las propiedades
comunes de ambos tipos:
function Ship(graphic, position) {
    this._graphic = graphic;
    this._position = position;
}

Ship.prototype.moveLeft = function () { this._position.x -= 2; };
Ship.prototype.moveRight = function () { this._position.x += 2; };

En este caso, probablemente sea mejor no incluir el método de disparar
shoot, ya que unas naves disparan hacia arriba y otras hacia abajo. Tampoco
incluiremos advance, puesto que es exclusivo de los enemigos y no de la nave
aliada.

Recuerda que ahora los constructores de la nave aliada y los enemigos pedirán
primero al constructor de nave que cree una nave y luego la personalizarán.
function Enemy(graphic, position, score) {
    Ship.apply(this, [graphic, position]);
    this._currentDirection = 'right';
    this._score = score;
}

function Ally(position) {
    Ship.apply(this, ['ally.png', position]);
}

Con apply
se puede ejecutar una función indicando cuál será su objeto de contexto y sus
parámetros.
Con la configuración anterior, las nuevas instancias de enemigos y aliados
pasarán primero por el constructor de Ship, que establecerá los atributos
comunes y luego estas instancias serán modificados cada una por el constructor
pertinente para convertirse en enemigos o en aliados.
En cuanto a la API, lo ideal sería contar con una cadena de prototipos de la siguiente manera:

Los atributos del enemigo (o del aliado) están en la propia instancia.

La API específica del tipo Enemy or Ally están en la propiedad
prototype del constructor de ese tipo.

La API común a los tipos Enemy y Ally está en la propiedad prototype del
constructor Ship.


var enemy = new Enemy()             Enemy.prototype      Ship.prototype
{ _position: ..., _score: ... } --> { advance: ... } --> { moveLeft: ... }
enemy._score -----↑                   ↑                    ↑
enemy.advance ------------------------|                    |
enemy.moveLeft --------------------------------------------|
Como ocurría con el ejemplo en la sección anterior, hay que crear la cadena
desde atrás hacia adelante. El enlace entre las instancias y los
constructores nos lo proporciona JavaScript al utilizar new, pero el enlace
entre la propiedad prototype de Enemy y la de Ship hay que que
establecerlo manualmente.
Prueba lo siguiente:
// Inspecciona el prototype de Enemy.
Enemy.prototype;

// Enlaza ambas propiedades prototype.
Enemy.prototype = Object.create(Ship.prototype);

// Inspecciona la propiedad prototype otra vez y busca diferencias.
Enemy.prototype;

// Corrige la propiedad constructor.
Enemy.prototype.constructor = Enemy;

// Añade el método específico del tipo Enemy.
Enemy.prototype.advance = function () {
    this._position.y += 2;
};

// Otro método específico.
Enemy.prototype.shoot = function () {
    var firePosition = new Point(this._position.x, this._position.y + 10);
    var shot = new Shot(firePosition, 2);
    return shot;
};

Y para el tipo Ally:
// Lo mismo para el aliado.
Ally.prototype = Object.create(Ship.prototype);
Ally.prototype.constructor = Ally;

Ally.prototype.shoot = function () {
    var firePosition = new Point(this._position.x, this._position.y - 10);
    var shot = new Shot(firePosition, -2);
    return shot;
};

Ahora sí, ya podemos crear un enemigo y un aliado usando sus constructores:
var enemy = new Enemy('enemy1.png', new Point(10, 10), 40);
var ally = new Ally(new Point(10, 590));

Object.getPrototypeOf(ally) === Ally.prototype;
Object.getPrototypeOf(enemy) === Enemy.prototype;
Ally.prototype !== Enemy.prototype;
Object.getPrototypeOf(Ally.prototype) === Object.getPrototypeOf(Enemy.prototype);
Object.getPrototypeOf(Ally.prototype) === Ship.prototype;

También podemos comprobar dónde está cada propiedad:
enemy.hasOwnProperty('_score');
enemy.hasOwnProperty('advance');
enemy.hasOwnProperty('moveLeft');

Enemy.prototype.hasOwnProperty('_score');
Enemy.prototype.hasOwnProperty('advance');
Enemy.prototype.hasOwnProperty('moveLeft');

Ship.prototype.hasOwnProperty('_score');
Ship.prototype.hasOwnProperty('advance');
Ship.prototype.hasOwnProperty('moveLeft');

Polimorfismo
Las relaciones de herencia que acabamos de establecer nos permiten decir que un
enemigo es una instancia del tipo Enemy, pero también lo es del tipo Ship.
Una misma instancia tiene múltiples formas gracias a la herencia. En
programación orientada a objetos a esto se lo llama polimorfismo.
Alternativamente, podemos decir que un enemigo es una instancia de Enemy
porque tiene la API de Enemy, o que es una instancia de Ship porque tiene
la API de Ship. Esto es equivalente a decir que las propiedades prototype
de Enemy y Ship están en la cadena de prototipos del objeto.
El operador instanceof devuelve verdadero si la propiedad prototype de la
función a la derecha del operador está en la cadena de prototipos del objeto a
la izquierda del operador.
enemy instanceof Enemy;  // Enemy.prototype es el primer eslabón.
enemy instanceof Ship;   // Ship.prototype es el segundo.
enemy instanceof Object; // Object.prototype, el tercero.

enemy instanceof Ally;   // Ally.prototype no está en la cadena.

En lo referente al estado, resulta conveniente saber qué constructor ha
construido el objeto para conocer de un vistazo los atributos que contendrá el
mismo. Esto es equivalente a determinar cuál es la función cuya propiedad
prototype es el primer eslabón de la cadena de prototipos.
Dado que los objetos prototipo vienen de serie con una propiedad constructor,
que por defecto apunta a la función que posee al objeto prototipo, basta con
acceder a la propiedad constructor a través de la instancia.
enemy.constructor;
enemy.constructor === Enemy; // fue construido por Enemy, no por Ship.
enemy.constructor !== Ship; // es cierto que Ship fue utilizado, pero nada más.

Duck typing

In other words, don't check whether it IS-a duck: check whether it
QUACKS-like-a duck, WALKS-like-a duck, etc, etc, depending on exactly what
subset of duck-like behaviour you need to play your language-games with.

Alex Martelli sobre polimorfismo
La cita se refiere a que más que comprobar si algo es una instancia de un
tipo, se debería comprobar si tiene la funcionalidad que es necesaria.
JavaScript es tan dinámico que el operador instanceof y la propiedad
constructor sólo tienen sentido si se siguen las convenciones que acabamos de ver.
Nada nos impide borrar la propiedad constructor de un prototipo o
sobreescribirla en un objeto determinado. De hecho, en las nuevas versiones de
JavaScript, el prototipo de un objeto puede cambiar después de que el objeto
haya sido construido.

02-javascript/0203-modelo-de-ejecucion/.body:
El modelo de ejecución de JavaScript
JavaScript se caracteriza por presentar un modelo de ejecución asíncrono, donde
los resultados no se encuentran disposibles inmediatamente, sino que lo
estarán en un futuro.
Ámbito y hoisting
Como en muchos lenguajes, los nombres de las variables pueden reutilizarse y
guardar valores distintos, siempre y cuando se encuentren en ámbitos
distintos.
El ámbito o scope de una variable es la porción de código donde puede ser
utilizada. Variables con el mismo nombre en ámbitos distintos son variables
distintas.
El ámbito en JavaScript es el cuerpo de la función, delimitado entre el
par de llaves { y } que siguen a la lista de parámetros de la función.
function introduction() {
    // Esta es la variable text.
    var text = 'I\'m Ziltoid, the Omniscient.';
    greetings();
    console.log(text);
}

function greetings(list) {
    // Y esta es otra variable text DISTINTA.
    var text = 'Greetings humans!';
    console.log(text);
}

introduction();

En JavaScript, las funciones pueden definirse dentro de otras funciones y, de
esta forma, anidar ámbitos.
El anidamiento de funciones es útil cuando se quieren usar funciones
auxiliares, normalmente cortas.
function getEven(list) {
    function isEven(n) {
        return n % 2 === 0;
    }
    return list.filter(isEven);
}

getEven([1, 2, 3, 4, 5, 6]);

Como el ámbito es el de la función, el mismo nombre en una función anidada se
puede referir a dos cosas:
1) Si se usa con var, se estará declarando otra variable distinta:
function introduction() {
    // Esta es una variable text.
    var text = 'I\'m Ziltoid, the Omniscient.';

    function greetings(list) {
        // Y esta es OTRA variable text distinta.
        var text = 'Greetings humans!';
        console.log(text);
    }

    greetings();
    console.log(text);
}

introduction();

En el caso anterior, decimos que la variable text de la función anidada
greetings oculta a la variable text de la función introduction.
Recuerda que para introducir una nueva variable hay que declararla con
var antes de usarla (o al mismo tiempo que se asigna).
2) Si se omite la palabra var, no se crea una nueva variable, sino que se
reutiliza la que ya existía.
function introduction() {
  // Esta es una variable text.
  var text = 'I\'m Ziltoid, the Omniscient.';

  function greetings(list) {
    // Esta es la MISMA variable text que la de afuera.
    text = 'Greetings humans!';
    console.log(text);
  }

  greetings();
  console.log(text);
}

introduction();

Hoisting
Hoisting significa "elevación", y en el contexto de la programación nos
referimos a un mecanismo que emplean algunos lenguajes respecto a la declaración
de nombres.
En JavaScript da igual en qué punto de la función se declara una variable.
JavaScript asumirá cualquier declaración como si ocurriese al comienzo de
la función.
Es decir que esto:
function f() {
    for (var i = 0; i 
Es equivalente a esto:
function f() {
    var i;
    var j;
    for (i = 0; i 
Fíjate que JavaScript alza la declaración de la variable (la lleva al
principio), no la inicialización. Es por eso que el siguiente código no falla,
pero imprime undefined:
function f() {
    console.log(i);
    var i = 5;
}
f();

En modo estricto, usar una variable que no ha sido declarada produce
un error.
function f() {
    console.log(i);
    i = 5;
}
f();

Con las declaraciones de funciones esto no pasa: cuando una declaración de
función se alza, se alza entera, definición incluida.
function getEven(list) {
    return list.filter(isEven);

    function isEven(n) {
        return n % 2 === 0;
    }
}

getEven([1, 2, 3, 4, 5, 6]);

Esto permite una forma de ordenar el código que quizá sea más clara, situando
las funciones auxiliares a continuación de las funciones que las utilizan.
Así, viendo sólo la primera línea de la función, ya podemos conocer qué es lo
que realiza.
    return list.filter(isEven);

Y, si aún tenemos dudas, podemos seguir leyendo e investigar qué hace la función
auxiliar.
    function isEven(n) {
        return n % 2 === 0;
    }

Nótese que para que esta manera de escribir código sea clara, el nombre que
utilicemos en las funciones auxiliares tiene que ser adecuado, descriptivo, y
dar una pista sobre cuál es el valor de retorno.
Closures
Las funciones son datos y se crean cada vez que se encuentra una instrucción
function. De esta forma, podemos crear una función que devuelva funciones.
function buildFunction() {
    return function () { return 42; };
}

var f = buildFunction();
var g = buildFunction();

typeof f === 'function';
typeof g === 'function';

f();
g(); // Las funciones hacen lo mismo...

f !== g; // ...pero NO son la misma función

Por sí solo, este no es un mecanismo muy potente, pero sabiendo que una función
anidada puede acceder a las variables de los ámbitos superiores, podemos hacer
algo así:
function newDie(sides) {
  return function () {
    return Math.floor(Math.random() * sides) + 1;
  };
}
var d100 = newDie(100);
var d20 = newDie(20);

d100 !== d20; // distintas, creadas en dos llamadas distintas a newDie.

d100();
d20();

En JavaScript, las funciones retienen el acceso a las variables en ámbitos
superiores. Una función que se refiere a alguna de las variables en ámbitos
superiores se denomina closure o clausura.
Esto no afecta al valor de this, que seguirá siendo el destinatario del
mensaje.
Métodos, closures y this
Considera el siguiente ejemplo:
var diceUtils = {
    history: [], // lleva el histórico de tiradas.

    newDie: function (sides) {
        return function die() {
            var result = Math.floor(Math.random() * sides) + 1;
            this.history.push([new Date(), sides, result]);
            return result;
        }
    }
}

La intención es poder crear dados y llevar un registro de todas las tiradas que
se hagan con estos dados.
Sin embargo, esto no funciona:
var d10 = diceUtils.newDie(10);
d10(); // ¡error!

Y es así porque this siempre es el destinatario del mensaje y d10 se
está llamando como si fuera una función y no un método.
Recuerda que podemos hacer que cualquier función tomara un valor forzoso como
this con .apply(); por lo que esto sí funciona, pero no es muy conveniente:
d10.apply(diceUtils);
d10.apply(diceUtils);
diceUtils.history;

Lo que tenemos que hacer es que la función die dentro de newDie se refiera
al this del ámbito superior, no al suyo.
Puedes lograr esto de dos maneras. La primera es un mero juego de variables,
guardando el this en una variable auxiliar (en este caso, self):
var diceUtils = {
    history: [], // Lleva el histórico de dados.

    newDie: function (sides) {
        var self = this; // self es ahora el destinatario de newDie.

        return function die() {
            var result = Math.floor(Math.random() * sides) + 1;
            // Usando self nos referimos al destinatario de newDie.
            self.history.push([new Date(), sides, result]);
            return result;
        }
    }
}

Esto sí funciona y es mucho más conveniente:
var d10 = diceUtils.newDie(10);
var d6 = diceUtils.newDie(6);
d10();
d6();
d10();
diceUtils.history;

La segunda forma es usando el método bind de las funciones.
El método bind de una función devuelve otra función cuyo this será el
primer parámetro de bind. De este modo:
var diceUtils = {
    history: [], // Lleva el histórico de dados.

    newDie: function (sides) {
        return die.bind(this); // una nueva función que llamará a die con su
                               // destinatario establecido al primer parámetro.

        function die() {
            var result = Math.floor(Math.random() * sides) + 1;
            this.history.push([new Date(), sides, result]);
            return result;
        }
    }
}

Las dos formas son ampliamente utilizadas, pero la segunda se ve escrita
muchas veces de este modo:
var diceUtils = {
    history: [], // Lleva el histórico de dados.

    newDie: function (sides) {
        return function die() {
            var result = Math.floor(Math.random() * sides) + 1;
            this.history.push([new Date(), sides, result]);
            return result;
        }.bind(this); // el bind sigue a la expresión de función.
    }
}

Módulos
Esta sección presenta la característica módulos, que es específica de Node.
Una de las principales desventajas de JavaScript (hasta la próxima versión)
es que no hay forma de organizar el código en módulos.
Los módulos sirven para aislar funcionalidad relacionada: tipos, funciones,
constantes, configuración…
Node sí tiene módulos y, afortunadamente, existen herramientas que simulan
módulos como los de Node en el navegador.
En Node, los ficheros JavaScript acabados en .js son módulos. Node nos permite
exponer o exportar funcionalidad de un módulo, poniéndola dentro del objeto
module.exports:
// En diceUtils.js
"use strict"; // pone el módulo en modo estricto.

var history = [];

function newDie(sides) {
    return function die() {
        var result = Math.floor(Math.random() * sides) + 1;
        history.push([new Date(), sides, result]);
        return result;
    };
}

// ¡Lo que se exporta realmente es el objeto module.exports!
module.exports.newDie = newDie;
module.exports.history = history;

Realmente, lo que se exporta es siempre module.exports, que en principio
es un objeto vacío:
typeof module.exports;
module.exports;

Ahora podemos ahora importar ese módulo desde otro:
// En cthulhuRpg.js
"use strict";

var diceUtils = require('./diceUtils');
var d100 = diceUtils.newDie(100);

var howard = {
    sanity: 45,
    sanityCheck: function () {
        if (d100() 
Para importar un módulo desde otro hay que pasar a require
la ruta relativa hasta el fichero del módulo que queremos importar.
Si en lugar de una ruta, pasamos un nombre, accederemos a la funcionalidad
que viene por defecto con Node (los módulos que forman parte de la librería
estándar, como path o fs) o la que instalemos de terceras partes (por
ejemplo, módulos instalados con el gestor de paquetes npm). Usaremos esta forma
en un par de ocasiones más adelante.
Diferencias entre ámbitos en Node y en el navegador
Se ha dicho que el ámbito en JavaScript es equivalente a la función, pero
sabemos que podemos abrir una consola o un fichero y empezar a declarar
variables sin necesidad de escribir una función.
Esto es así porque estamos usando el ámbito global. El ámbito global está
disponible tanto en el navegador como en Node.
// Esta es una variable text en el ámbito GLOBAL.
var text = 'I\'m Ziltoid, the Omniscient.';

// Esta es una función en el ámbito GLOBAL.
function greetings(list) {
    // Esta es OTRA variable text en el ámbito de la función.
    var text = 'Greetings humans!';
    console.log(text);
}

greetings();
console.log(text);

Sin embargo, existe una peculiaridad en Node. El ámbito global es realmente
local al fichero. Esto quiere decir que:
// En a.js, text es visible únicamente dentro del FICHERO.
"use strict";
var text = 'I\'m Ziltoid, the Omniscient.';

// En b.js, text es visible únicamente dentro del FICHERO.
"use strict";
var text = 'Greetings humans!';

// En una consola iniciada en el mismo directorio que a y b
require('./a');
require('./b');
text;

Programación asíncrona y eventos
Prueba el siguiente ejemplo (copia, pega y espera 5 segundos):
var fiveSeconds = 5 * 1000; // en milisegundos.

// Esto ocurre ahora.
console.log('T: ', new Date());

setTimeout(function () {
    // Esto ocurre pasados 5 segundos.
    console.log('T + 5 segundos: ', new Date());
}, fiveSeconds);

// Esto ocurre inmediatamente después
console.log('T + delta: ', new Date());

Como puedes comprobar, el mensaje se completa pasados 5 segundos porque lo que
hace setTimeout
es llamar a la función tan pronto como pasen el número de milisegundos
indicados.
Decimos que una función es un callback si se llama en algún momento
futuro –es decir, asíncronamente– para informar de algún resultado.
En el ejemplo de setTimeout, el resultado es que ha pasado la cantidad de
tiempo especificada.
Eventos
En esta sección veremos el módulo readline, que es específico de Node.
La programación asíncrona en JavaScript y otros lenguajes se usa para modelar
eventos, principalmente esperas por entrada y salida. En otras palabras:
hitos que ocurren pero que no sabemos cuándo ocurren.
La entrada y salida –a partir de ahora IO (del inglés input / output)– no
sólo supone lectura de ficheros o peticiones a la red, también incluye esperar
una acción del usuario.
Como ejemplo, vamos a implementar una consola de diálogo por líneas. Usaremos el
módulo readline, que es parte de la
librería estándar que viene con Node:
// En conversational.js
"use strict";

var readline = require('readline');

var cmd = readline.createInterface({
    input: process.stdin,  // así referenciamos la consola como entrada.
    output: process.stdout, // y así, como salida.
    prompt: '(╯°□°）╯ ' // lo que aparece para esperar la entrada del usuario.
});

Lanza ese programa con Node y verás que no hace nada, pero tampoco termina.
Esto es típico de los programas asíncronos: el programa queda esperando a que
pase algo. Pulsa ctrl+c para terminar el programa.
Ahora prueba:
// Añade al final de conversational.js
console.log('Escribe algo y pulsa enter');
cmd.prompt(); // pide que el usuario escriba algo.

cmd.on('line', function (input) {
    console.log('Has dicho "' + input  + '"');
    cmd.prompt(); // pide que el usuario escriba algo.
});

Lo que has conseguido es escuchar el evento line que se produce
cada vez que en la entrada se recibe un caracter de cambio de línea.
Hablando de eventos, la función que se ejecuta asíncronamente recibe el nombre de
listener, pero tampoco es raro que se la llame callback.
Se habla de "registrar un listener para un evento", "subscribirse a un
evento" o "escuchar un evento" a utilizar el mecanismo que permite asociar la
ejecución de una función con dicho evento.
Con todo, aún no se puede salir del programa anterior. Necesitamos algunos
cambios más:
// Añade a conversational.js
cmd.on('line', function (input) {
    if (input === 'salir') {
        cmd.close();
    }
});

cmd.on('close', function () {
    console.log('¡Nos vemos!');
    process.exit(0); // sale de node.
});

Hemos añadido un segundo listener al evento line y ambos se ejecutarán.
El primero gestiona el funcionamiento por defecto (que es repetir lo que el
usuario ha introducido) y el segundo trata específicamente el comando salir.
Si la línea es exactamente salir, cerraremos la interfaz de línea de
comandos. Esto produce un evento close y, cuando lo recibamos, utilizaremos el
listener de ese evento para terminar el programa.
El método on es un segundo nombre para addListener.
Igual que podemos añadir un listener, también podemos eliminarlo con
removeListener,
y quitarlos todos con
removeAllListeners.
Podemos escuchar un evento sólo una vez con
once.
Emisores de eventos
Ahora veremos la clase EventEmitter, que también es específica de Node.
Los eventos no son un mecanismo estándar de JavaScript. Son una forma
conveniente de modelar determinados tipos de problema, pero un objeto JavaScript,
por sí solo, no tiene API para emitir eventos.
En Node contamos con diversas alternativas con el fin de que los objetos emitan
eventos:

Implementar nuestra propia API de eventos.

Hacer que nuestros objetos usen una instancia de EventEmitter.

Hacer que nuestros objetos sean instancias de EventEmitter.


La primera supondría crear nuestro propio método on y los mecanismos para
emitir eventos. La segunda y la tercera usan la clase
EventEmitter,
que ya implementa esta API.
Este es un ejemplo de la opción 3 –el cual aprovechamos para repasar la
herencia:
var events = require('events');
var EventEmitter = events.EventEmitter;

function Ship() {
    EventEmitter.apply(this);
    this._ammunition = 'laser charges';
}

Ship.prototype = Object.create(EventEmitter.prototype);
Ship.prototype.constructor = Nave;

var ship = new Ship();
ship.on; // ¡existe!

Ahora que la nave puede emitir eventos, vamos a hacer que dispare y que emita un
evento.
Ship.prototype.shoot = function () {
    console.log('PICHIUM!');
    this.emit('shoot', this._ammunition); // parte de la API de EventEmitter.
};

ship.on('shoot', function (ammunition) {
    console.log('CENTRO DE MANDO. La nave ha disparado:', ammunition);
});

ship.shoot();

Emitir un evento consiste en llamar al método
emit,
que hará que se ejecuten los listeners que escuchan tal evento.
Los eventos son increiblemente útiles para modelar interfaces de usuario de
forma genérica.
Para ello, los modelos deben publicar qué les ocurre: cómo cambian, qué
hacen… Todo a base de eventos. Las interfaces de usuario se
suscribirán a estos eventos y proporcionarán la información visual adecuada.
Este modelo permite además que varias interfaces de usuario funcionen al mismo
tiempo, todas escuchando los mismos eventos. Sin embargo, también permite
dividir la interfaz en otras más especializadas, cada una escuchando un
determinado conjunto de eventos.

02-javascript/02-ejercicios/.body:
Ejercicios guiados
Prueba estos ejemplos y trata de responder a las preguntas. Si te atascas con
lo que hace una función, busca en Internet la función acompañada de "mdn".
1. Valores booleanos en JavaScript.
En JavaScript cualquier valor puede considerarse verdadero o falso según el
contexto. Por ejemplo, el 0 es considerado false y cualquier número distinto
de 0 es true:
var v = 0; // después de esta prueba, cambia el valor de v por otro número.
!!v; // la doble negación al comienzo lo convierte en booleano.

Descubre qué valores son ciertos y cuales falsos para todos los tipos: números,
cadenas, objetos, funciones y undefined.
2. Expresiones booleanas en JavaScript.
En JavaScript, las expresiones booleanas son vagas, esto significa que en
cuanto el intérprete de JavaScript sabe lo que va a valer la expresión,
dejamos de evaluar. Por ejemplo, ¿qué crees que le pasará a la siguiente
expressión?
var hero = { name: 'Link', weapon: null };
console.log('Hero weapon power is:', hero.weapon.power);

Pero, ¿y ahora?
var hero = { name: 'Link', weapon: null };
if (hero.weapon && hero.weapon.power) {
  console.log('Hero weapon power is:', hero.weapon.power);
} else {
  console.log('The hero has no weapon.');
}

En caso de expresiones && (and o y), la evaluación termina tan pronto como
encontramos un término falso.
En caso de expresiones || (or u o), la evaluación termina tan pronto como
encontramos un término verdadero.
3. El resultado de las expresiones booleanas.
Contra el sentido común, el resultado de una expresión booleana no es un
booleano sino el último término evaluado. Recuerda que la evaluación es vaga
y JavaScript deja de evaluar tan pronto como puede determinar el resultado de la
expresión. Con esto en cuenta, trata de predecir el resultado de las siguientes
expresiones:
var v;
function noop() { return; };

1 && true && { name: 'Link' };
[] && null && "Spam!";
null || v || noop || true;
null || v || void "Eggs!" || 0;

4. Parámetros por defecto.
Puedes ver una aplicación real de lo anterior en esta función para rellenar
números. En JavaScript no hay parámetros por defecto, pero los parámetros
omitidos tienen el valor especial undefined que es falso.
function pad(target, targetLength, fill) {
  var result = target.toString();
  var targetLength = targetLength || result.length + 1;
  var fill = fill || '0';
  while (result.length 
5. Buenas prácticas en el diseño de APIs.
Se ha dicho muchas veces que el estado no se debería exponer pero siempre
se acaba enseñando este tipo de modelado para los puntos:
var p = { x: 5, y: 5 };

function scale(point, factor) {
  point.x = point.x * factor;
  point.y = point.y * factor;
  return p;
}

scale(p, 10);

La implementación correcta sería:
var p = {
  _x: 5,
  _y: 5,
  getX: function () {
    return this._x;
  },
  getY: function () {
    return this._y;
  },
  setX: function (v) {
    this._x = v;
  },
  setY: function (v) {
    this._y = v;
  }
};

function scale(point, factor) {
  point.setX(point.getX() * factor);
  point.setY(point.getY() * factor);
  return p;
}

scale(p, 10);

Pero reconócelo, escribir tanto es un rollo soberano.
6. Propiedades computadas al rescate.
JavaScript permite definir un tipo especial de propiedades llamadas normalmente
propiedades computadas de esta guisa:
var p = {
  _x: 5,
  _y: 5,
  get x() {
    return this._x;
  },
  get y() {
    return this._y;
  },
  set x(v) {
    this._x = v;
  },
  set y(v) {
    this._y = v;
  }
};

function scale(point, factor) {
  point.x = point.x * factor;
  point.y = point.y * factor;
  return p;
}

scale(p, 10);

Escribirlo sigue siendo un muermo (menos mal que has estudiado como hacer
factorías de objetos) pero utilizarlo es mucho más claro. Así, si ahora decides
que sería mejor exponer el nombre de los ejes en mayúscula, puedes hacer:
var p = {
  _x: 5,
  _y: 5,
  get X() {
    return this._x;
  },
  get Y() {
    return this._y;
  },
  set X(v) {
    this._x = v;
  },
  set Y(v) {
    this._y = v;
  }
};

function scale(point, factor) {
  point.X = point.X * factor;
  point.Y = point.Y * factor;
  return p;
}

scale(p, 10);

¿Se te ocurre la manera de hacer que una propiedad pueda ser de sólo lectura? Es
decir, que su valor no pueda cambiarse (asumiendo que el usuario no accederá a
las propiedades que comiencen por '_').
Si quisieras añadir una propiedad a un objeto ya existente tendrías que utilizar
Object.defineProperty():
var point = {};
Object.defineProperty(point, '_x', { value: 5, writable: true });
Object.defineProperty(point, '_y', { value: 5, writable: true });
Object.defineProperty(point, 'x', {
  get: function () {
    return this._x;
  },
  set: function (v) {
    this._x = v;
  }
});
Object.defineProperty(point, 'y', {
  get: function () {
    return this._y;
  },
  set: function (v) {
    this._y = v;
  }
});
point; // no se observan propiedades...
point.x; // ...pero aquí están.
point.y;

¿Te atreves a decir por qué cuando inspeccionamos el objeto no aparecen sus
propiedades? ¿Cómo podrías arreglarlo? ¿Cómo harías para que sólo se vieran
las propiedades que son parte de la API?
No te lances a usar Object.defineProperty() si no tienes muy claro qué
significan los términos configurable, enumerable y writable.
7. Usando funciones como si fueran métodos.
Hemos visto que cualquier función puede usarse como un método si se referencia
como una propiedad de un objeto y entonces se llama. Pero lo cierto es que
también puedes hacer que una función cualquiera, sin estar referenciada desde
una propiedad, pueda ser usada como el método de un objeto si indicamos
explícitamente cual es el objeto destinatario. Esto puede hacerse con
.apply()
y con
.call().
var ship = { name: 'Death Star' };

function fire(shot) {
  console.log(this.name + ' is firing: ' + shot.toUpperCase() + '!!!');
}

ship.fire; // ¿qué crees que será esto?
fire.apply(ship, ['pichium']);
fire.call(ship, 'pañum');

¿Cuál es la diferencia entre .apply() y .call()?
8. Propiedades dinámicas.
La notación corchete para acceder a las propiedades de un objeto es
especialmente útil para acceder a propiedades de manera genérica. Por ejemplo,
imagina el siguiente código:
var hero = {
  name: 'Link',
  hp: 10,
  stamina: 10,
  weapon: { name: 'sword', effect: { hp: -2 } }
};
var enemy = {
  name: 'Ganondorf',
  hp: 20,
  stamina: 5,
  weapon: { name: 'wand', effect: { hp: -1, stamina: -5 } }
};

function attack(character, target) {
  if (character.stamina > 0) {
    console.log(character.name + ' uses ' + character.weapon.name + '!');
    applyEffect(character.weapon.effect, target);
    character.stamina--;
  } else {
    console.log(character.name + ' is too tired to attack!');
  }
}

function applyEffect(effect, target) {
  // Obtiene los nombres de las propiedades del objeto. Búscalo en la MDN.
  var propertyNames = Object.keys(effect);
  for (var i = 0; i 
¿Podrías modificar el efecto del arma del héroe para incapacitar al enemigo pero
no matarlo ni dañarlo? Intenta hacerlo sin reescribir el ejemplo entero, es
decir, continuando desde el término del ejemplo.
9. Objetos como algo más que objetos.
Los objetos de JavaScript no solo sirven para modelar los objetos de la
programación orientada a objetos sino que permiten realizar clasificaciones por
nombre. Un histograma, es decir un conteo de un conjunto con repeticiones, es
un ejemplo clásico de la utilidad de un objeto JavaScript:
function wordHistogram(text) {
  var wordList = text.split(' ');
  var histogram = {};
  for (var i = 0; i 
Prueba a usar la función por ti mismo.
Lo que JavaScript llama objetos se conoce en otros lenguajes de programación
como mapas o diccionarios y a los nombres de las propiedades se los llama
claves.
¿Puedes pensar en al menos una aplicacion más?
10. Funciones como parámetros.
Las listas de JavaScript tiene algunos métodos que aceptan funciones como
parámetros, por ejemplo
.forEach().
De hecho es común encontrar .forEach() cuando se tiene la certeza de que se
van a recorrer todos los elementos de una lista.
function wordHistogram(text) {
  var wordList = text.split(' ');
  var histogram = {};
  wordList.forEach(function (word) {
    if (!histogram.hasOwnProperty(word)) {
      histogram[word] = 0;
    }
    histogram[word]++;
  });
  return histogram;
}

var poem = 'Todo pasa y todo queda, ' +
           'pero lo nuestro es pasar, ' +
           'pasar haciendo caminos, ' +
           'caminos sobre la mar';

wordHistogram(poem);

El resultado no es correcto porque al separar las palabras por los espacios
estás dejando caracteres que no forman palabras como parte de ellas. Puedes
arreglarlo si en vez de partir el texto por los espacios usas una
expresión regular
para partir el texto por los límites de las palabras:
function wordHistogram(text) {
  var wordList = text.split(/\b/); // Eso entre / / es una expresión regular.
  var histogram = {};
  wordList.forEach(function (word) {
    if (!histogram.hasOwnProperty(word)) {
      histogram[word] = 0;
    }
    histogram[word]++;
  });
  return histogram;
}

var poem = 'Todo pasa y todo queda, ' +
           'pero lo nuestro es pasar, ' +
           'pasar haciendo caminos, ' +
           'caminos sobre la mar';

wordHistogram(poem);

Pero ahora tendrás cosas que no son palabras (como espacios y comas). Puedes
filtrar una lista con
.filter():
function isEven(n) { return n % 2 === 0; }
[1, 2, 3, 4, 5, 6].filter(isEven);

Y así quitar lo que no sean palabras:
function isWord(candidate) {
  return /\w+/.test(candidate);
}

function wordHistogram(text) {
  var wordList = text.split(/\b/);
  wordList = wordList.filter(isWord);
  var histogram = {};

  wordList.forEach(function (word) {
    if (!histogram.hasOwnProperty(word)) {
      histogram[word] = 0;
    }
    histogram[word]++;
  });
  return histogram;
}

var poem = 'Todo pasa y todo queda, ' +
           'pero lo nuestro es pasar, ' +
           'pasar haciendo caminos, ' +
           'caminos sobre la mar';

wordHistogram(poem);

También deberías normalizar las palabras (pasarlas a minúsculas por ejemplo)
para no encontrarnos con entradas distintas en el histograma para la misma
palabra. Para transformar una lista en otra lista con el mismo número de
elementos usamos
.map().
function isWord(candidate) {
  return /\w+/.test(candidate);
}

function toLowerCase(word) {
  return word.toLowerCase();
}

function wordHistogram(text) {
  var wordList = text.split(/\b/);
  wordList = wordList.filter(isWord);
  wordList = wordList.map(toLowerCase);
  var histogram = {};

  wordList.forEach(function (word) {
    if (!histogram.hasOwnProperty(word)) {
      histogram[word] = 0;
    }
    histogram[word]++;
  });
  return histogram;
}

var poem = 'Todo pasa y todo queda, ' +
           'pero lo nuestro es pasar, ' +
           'pasar haciendo caminos, ' +
           'caminos sobre la mar';

wordHistogram(poem);

Una última función te permite transformar una lista en un sólo valor. Esto es
precisamente el histograma, una clasificación de todos los valores de la lista.
Esta transformación se consigue mediante
.reduce():
function isWord(candidate) {
  return /\w+/.test(candidate);
}

function toLowerCase(word) {
  return word.toLowerCase();
}

function buildHistogram(inProgressHistogram, word) {
  if (!inProgressHistogram.hasOwnProperty(word)) {
    inProgressHistogram[word] = 0;
  }
  inProgressHistogram[word]++;
  return inProgressHistogram;
}

function wordHistogram(text) {
  var emptyHistogram = {};
  return text.split(/\b/)
             .filter(isWord)
             .map(toLowerCase)
             .reduce(buildHistogram, emptyHistogram);
}

var poem = 'Todo pasa y todo queda, ' +
           'pero lo nuestro es pasar, ' +
           'pasar haciendo caminos, ' +
           'caminos sobre la mar';

wordHistogram(poem);

11. Número variables de parámetros
Fíjate en esto:
console.log('I\'m', 'Ziltoid');
console.log('I\'m', 'Ziltoid,', 'the', 'Omniscient');
Math.max(1);
Math.max(1, 2);
Math.max(1, 2, 3);

Como puedes ver, la función acepta un número cualquiera de variables. Podemos
hacer lo mismo gracias a la variable implícita arguments.
function f() {
  console.log('Número de argumentos pasados:', arguments.length);
  console.log('Argumentos:', arguments);
}
f();
f(1);
f('a', {});
f(function () {}, [], undefined);
Busca la información sobre arguments en la
MDN. ¡Te hará falta!
12. Decoradores
Aparte de devolverse como parámetros, las funciones pueden ser devueltas desde
otras functiones. Considera el siguiente ejemplo:
function newLog(label) {
  return function(value) {
    console.log(label + ':', value);
  }
}

Esta función crea funciones que llamarán a console.log() pero con una
etiqueta delante. Podríamos crear métodos log por clase, cada uno con
un prefijo y así distinguir unos logs de otros.
Sin embargo, advierte el siguiente comportamiento:
var log1 = newLog('Default');
var log2 = newLog('Ziltoid');

var p = { x: 1, y: 10 };
log1(p);
log2(p);
log1('Greetings', 'humans!');

¿Cual es el problema? ¿Por qué no funciona el último ejemplo?
Para hacer que funcione, tendrías que llamar a console.log() con un número
de parámetros que no sabemos a priori. Puedes usar arguments, no obstante:
function newLog(label) {
  return function() {
    // ¿Por qué tenemos que hacer esto?
    var args = Array.prototype.slice.call(arguments);
    args.splice(0, 0, label + ':');
    console.log.apply(console, args);
  }
}

var log1 = newLog('Default');
var log2 = newLog('Ziltoid');

var p = { x: 1, y: 10 };
log1(p);
log2(p);
log1('Greetings', 'humans!');

¿Podrías decir qué hace cada línea en la función newLog?
13. Asincronía y closures
Carga el siguiente código:
function scheduleTasks(count) {
  for(var i = 1; i 
Y trata de predecir qué pasará al ejecutar el siguiente código:
scheduleTasks(5);

¿Hace lo que esperabas? Si no es así, ¿por qué? ¿cómo lo arreglarías? Pista:
necesitas la función .bind().
14. Eventos y métodos
Habrá veces en las que tendrás que llamar a un método de un objeto cuando ocurra
algo. Por ejemplo, supón que el método avanzar de un supuesto objeto debe
llamarse en un intervalo de tiempo. Pongamos cada segundo:
var obj = {
  x: 10,
  y: 2,
  advance: function () {
    this.y += 2;
    console.log('Ahora Y vale', this.y);
  }
};

var id = setInterval(obj.advance, 1 * 1000);

Este ejemplo falla porque en la última línea no estamos llamando a la
función sino sólo pasándola como parámetro. La función setInterval no
tiene idea del destinatario del mensaje y por tando no puede llamar a la función
como si fuera un método.
Podemos arreglarlo con bind pero antes para el intervalo con:
clearInterval(id);

Puedes solucionar el problema con:
var id = setInterval(obj.advance.bind(obj), 1 * 1000);

15. La función bind()
A estas alturas ya deberías saber cómo funciona bind o qué hace. Si aun no
lo tienes claro, búscalo en la MDN.
La tarea es la siguiente: crea una función bind que simule el comportamiento
del método de las funciones .bind(). Como se pide una función y no un método,
el primer parámetro será la función. Así pues, en vez de usarse así:
function die(sides) {
  var result = Math.floor(Math.random() * sides) + 1;
  this.history.push(result);
  return result;
}
var obj = { history: [] };
var d20 = die.bind(obj, 20);
d20();

La usarrás de esta otra forma:
function die(sides) {
  var result = Math.floor(Math.random() * sides) + 1;
  this.history.push(result);
  return result;
}
var obj = { history: [] };
var d20 = bind(die, obj, 20); // fíjate en que ahora die es el primer parámetro
d20();

02-javascript/02-practica/TDD.html.body:
TDD: Desarrollo dirigido por tests
Practicando TDD, iremos escribiendo código de forma que los tests pasen. Los
tests vienen dados pero están desactivados. La guía de la práctica recomienda en qué orden activar los tests para completar la práctica
poco a poco.
Tests y suites
En esta práctica usamos Jasmine como framework
para tests. En Jasmine escribimos suites y tests. Las suites se pueden anidar
y pueden llevar código de inicialización. En general, la API de Jasmine es muy
clara y no necesita mayor explicación. De todas formas, aquí tienes un ejemplo:
describe('Los suites en Jasmine', function () {

  describe('pueden anidarse', function () {

    it('y encierran tests con expectativas', function () {
      expect(2 + 2).toBe(4);
    });

  });

});

Se llama test a un fragmento de código que pone a prueba una funcionalidad
específica. El test puede pasar o fallar. En caso de fallo, la consola mostrará
por qué ha fallado en la forma de una traza:
15.2) Expected 'b' to be 'c'.
    Error: Expected 'b' to be 'c'.
        at stack (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1640:17)
        at buildExpectationResult (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1610:14)
        at Spec.expectationResultFactory (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:655:18)
        at Spec.addExpectationResult (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:342:34)
        at Expectation.addExpectationResult (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:599:21)
        at Expectation.toBe (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1564:12)
        at Object. (/Users/salva/workspace/pvli2017-rpg-battle/spec/TurnList.js:39:36)
        at attemptSync (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1950:24)
        at QueueRunner.run (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1938:9)
        at QueueRunner.execute (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1923:10)

La traza contiene el fallo y dónde se ha producido en el conjunto de llamadas
desde la más reciente hasta la más vieja. A veces los fallos son producto de
implementaciones que no cumplen las expectativas, otras veces serán fallos en
tiempo de ejecución y otras serán fallos de sintaxis.
Acostúmbrate a fallar y a encontrar en la traza el punto exacto del código que
está bajo tu control para solucionarlo. Para ello busca las carpetas spec y
src entre la traza. El primer número tras la ruta es la línea del fallo.
Activando y desactivando tests
Los tests y las suites pueden desactivarse añadiendo el prefijo x. Por
ejemplo:
describe('Los suites en Jasmine', function () {

  describe('pueden anidarse', function () {

    it('y encierran tests con expectativas', function () {
      expect(2 + 2).toBe(4);
    });

    xit('este test está desactivado', function () {

    });

  });

  xdescribe('la suite y todos sus tests están desactivados.', function () {

  });

});

Los tests desactivados no comprueban las expectativas pero Jasmine te
informa de que están desactivados.
El ciclo de desarrollo
Cuando estés desarrollando, es conveniente que pases los test a menudo por dos
motivos:

Comprobar que avanzas.
Comprobar que no has roto nada.

Para ello puedes ejecutar el comando:
$ npm run-script watch
Esta tarea monitoriza los cambios en los archivos de las carpetas spec y
src y cuando detecte un cambio, lanzara todos los tests.
A veces, el error es tan estrepitoso que rompe la monitorización. En tal caso
tendrás que reintroducir el comando manualmente.
Cada vez que realices una modificación y los tests pasen, haz un commit nuevo.
Depurando tests asíncronos
Algunos tests son asíncronos y pueden producir timeouts. En general un
timeout no es un resultado positivo. El problema de los timeouts es que
pueden ralentizar toda la suite así que la recomendación en estos casos es
afrontarlos uno a uno, desactivando el resto y activándolos poco a poco.
Reconocerás un test asíncrono porque lleva un parámetros done como en el
ejemplo:
var EventEmitter = require('events').EventEmitter;

describe('EventEmitter', function () {

  it('emite eventos arbitrarios', function (done) {
    var ee = new EventEmitter();
    ee.on('turn', function(turn) {
      expect(turn.number).toBe(1);
      done();
    });
    ee.emit('turn', { number: 1 });
  });

});

Estrategia general para la depuración
Es muy recomendable que mantengas una rama estable donde todos los tests pasen
y los que no estén desactivados. Cuando te embarques en la tarea de hacer que
un test pase, crea una rama para esa tarea y cuando termines mézclala con la
rama estable.
Cuando encuentres un error, intenta seguir los siguientes pasos:

Desactiva los tests asíncronos que estén tardando rápido. Necesitas un
ciclo de desarrollo rápido.
¡¡Lee el error!!.
Busca en la traza el lugar donde se original el error:
Si es un fallo en una expectativa, localiza el punto de entrada en
tu código.
Deja trazas con console.log() inspeccionando el estado de tus objetos.


Salva y relanza los tests a menudo.

